import React from 'react';

const SearchJobs: React.FC = () => {
  return (
    <div className="bg-purple-100 p-6 rounded-2xl shadow-lg w-full h-[255px] flex flex-col">
      <h2 className="text-xl font-bold text-center mb-4">Search Jobs</h2>
      <div className="flex justify-center">
        <input
          type="text"
          placeholder="Search jobs by title, company or skill"
          className="w-full p-3 rounded-full border border-gray-300 focus:outline-none focus:ring-2 focus:ring-purple-500/20 focus:border-purple-500"
        />
      </div>
    </div>
  );
};

export default SearchJobs;
